function [state, covariance]=filter_byAngularVelocity(state,covariance,measurement, gyro,dt,Q,alpha,beta,R)

z=measurement;
w=gyro;
UKFx=state; UKFP=covariance;
[X,W] = computeSigmaPoints(UKFx,UKFP);

% Propagate sigma points through transition function
Xkk1 = X;
for i=1:size(X,2)
    Xkk1(1:size(UKFx,1),i) = X(:,i)+ dt*[-skew(w) skew(w);zeros(3,3) zeros(3,3)]* X(:,i);
end

% Recombine weighted sigma points to produce predicted state and covariance
xkk1 = Xkk1*W;%wmean(Xkk1,W);      
Pkk1 = wcov(Xkk1,W,alpha,beta) + Q;

% propagate sigma points through observation function
Zkk1=Xkk1(1:3,:); %measurement = state

% Recombine weighted sigma points to produce predicted measurement and covariance
zkk1 =Zkk1*W;% wmean(Zkk1,W);
Pzz =  wcov(Zkk1,W,alpha,beta) + R;

% 2. Update
% Compute state-measurement cross-covariance matrix
Pxz = zeros(6,3);
for i=1:length(W)
    Pxz = Pxz + W(i)*(Xkk1(:,i)-xkk1)*(Zkk1(:,i)-zkk1)';
end
Pxz = Pxz + (1-alpha^2+beta)*(Xkk1(:,1)-xkk1)*(Zkk1(:,1)-zkk1)';
Kk = Pxz/Pzz;% Compute kalman gain

xk1 = xkk1 + Kk*(z-zkk1);% Compute state and measurement estimates
Pk1 = Pkk1 - Kk*Pzz*Kk';

covariance=Pk1;
state =xk1;
%calibrated_measurement=xk1(1:3)-xk1(4:6);
end

function [X,W,mX,PX] = computeSigmaPoints(mx,Pxx)
% computeSigmaPoints   Sigma point calculation
%   computes a set of sigma points defined by samples X and weights W,
%   given mean mx, covariance Pxx, a sigma point method, free parameters, a
%   scaling parameter, and a matrix square root function.
%%   X will be formatted such that the rows are variables and the columns
%   are samples. W will be a row vector. mx must be a column vector. Pxx
%   must be a square matrix.

alpha = 1; % Set default options
n = size(mx,1);% Compute number of samples
beta=2;% Check for beta parameter
kappa = 0;% Compute sigma points

X=zeros(6,2*n+1);
X(1:6,1) = mx;% Compute unscaled sigma points
matrixSq = Cholp((n+kappa)*Pxx)';
X(1:6,2:n+1) = repmat(mx,1,n) + matrixSq;
X(1:6,n+2:2*n+1) = repmat(mx,1,n) - matrixSq;


W=zeros(2*n+1,1);% Compute weights
W(1) = kappa/(n+kappa); W(2:2*n+1) = .5/(n+kappa);

p = size(X,2);% Scale the sigma points
X = repmat(X(:,1),1,p) + alpha*(X-repmat(X(:,1),1,p));

W(1) = W(1)/alpha^2 + (1-1/alpha^2);W(2:end) = W(2:end)/alpha^2;% Compute weights


mX = X*W; %wmean(X,W);% Compute weighted mean and covariance
PX = wcov(X,W,alpha,beta);


end


function Pxx = wcov(X,w,alpha,beta)
% wcov   Weighted covariance calculation
mX = X*w;% wmean(X,w);%weighted mean

Pxx =zeros(size(X,1),size(X,1));
for i=1:size(X,2)
    Pxx = Pxx + w(i)*(X(:,i)-mX)*(X(:,i)-mX)';
end
Pxx = Pxx + (1-alpha^2+beta)*(X(:,1)-mX)*(X(:,1)-mX)';
end

function R=Cholp(A)
   % CHOLESKY computes the Cholesky decomposition of a matrix
   %   R=Cholesky(A) computes the Cholesky decomposition A=R'R
   R=zeros(size(A,1));
   n=length(A);
   for j=1:n
       v=A(j,j:n);
       if j>1
           v=A(j,j:n)-R(1:j-1,j)'*R(1:j-1,j:n);
       end 
       if v(1)<=0
           R=eye(size(A,1));%error('Matrix is not positive definite')
           return;
       else
           h=1/sqrt(v(1));
       end
       R(j,j:n)=v*h;
   end
end

function xhat = skew(x)
% Computes the hat map, mapping a 3-vector into a 3X3 skew-symmetric matrix
xhat = [  0   -x(3)  x(2)
    x(3)   0   -x(1)
    -x(2)  x(1)  0];

end

